  false,\n\t\"url\": null,\n\t\"notes\": \"These files show the number of MetroCard
  swipes made each week by customers entering each station of the New York City Subway,
  PATH, AirTrain JFK and the Roosevelt Island Tram, broken out to show the relative
  popularity of the various types of MetroCards. MTA New York City Transit posts the
  latest data every Saturday by 1 a.m., and the dates listed in the links reference
  the date the data is posted. The data in the files covers seven-day periods beginning
  on the Saturday two weeks prior to the posting date and ending on the following
  Friday.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
